import React from "react";
import {Link } from 'react-router-dom';
import style from "./landin.module.css"


export function Landing() {

  return (
   
    <div className={style.container} >
     <Link to="/Home">
     <button >aqui vamos al home</button>
     </Link>
    </div>
  );
}

export default Landing;
